import React from "react";
import "./styles/ActiveCalls.css"

function ActiveCalls(){

    return(
        <div>
        <table>
        <h3>Active Calls</h3>
        <tr>
        <td>Name</td>
        <td>Area</td>
        <td>Type</td>
        </tr>
        </table>
        </div>

    )
}

export default ActiveCalls;
